import React, { useState, useEffect, useRef } from 'react';
import Typography from '@mui/material/Typography';
import untitled from './image/Untitled.png';
import MosGames from './image/Mo\'s Games logo.png';
import mohammedGithub from './image/Mohammed_github.png';
import Nodejs from './image/node.png';
import theresidentsclub from './image/theresidentsclub.png';
import clearear from './image/Clearear.jpg';
import Javascript from './image/javascript.png';
import react from './image/React.png';
import Python from './image/python.png';
import SQL from './image/sql-logo.png';
import kotlin from './image/kotlin.png';
import selenium from './image/Selenium.png';
import renuem from './image/Renuem.png';
import './Aboutme.css';

const MainContent = () => {
  const [isMobileView, setIsMobileView] = useState(false);
  const [tooltipVisible, setTooltipVisible] = useState({});
  const [visibleSections, setVisibleSections] = useState({});

  const aboutRef = useRef(null);
  const Techlogo = useRef(null);
  const mainContentRef = useRef(null);

  useEffect(() => {
    const updateView = () => setIsMobileView(window.innerWidth <= 1050);
    updateView();
    window.addEventListener('resize', updateView);
    return () => window.removeEventListener('resize', updateView);
  }, []);

  const handleLogoHover = (id) => {
    setTooltipVisible({ ...tooltipVisible, [id]: true });
  };

  const handleLogoLeave = (id) => {
    setTooltipVisible({ ...tooltipVisible, [id]: false });
  };

  const techLanguages = [
    { id: 'javascript', src: Javascript, name: 'Javascript' },
    { id: 'react', src: react, name: 'React.js' },
    { id: 'Node.js', src: Nodejs, name: 'Node.js' },
    { id: 'python', src: Python, name: 'Python' },
    { id: 'SQL', src: SQL, name: 'SQL' },
    { id: 'kotlin', src: kotlin, name: 'Kotlin' },
    { id: 'selenium', src: selenium, name: 'Selenium' },
  ];

  const workHistory = [
    {
      id: '2024-present',
      icon: renuem,
      title: 'Renuem',
      role: 'Full Stack Developer',
      description: [
        'Developed a renewable energy investment app using React Native and Node.js.',
        'Integrated MySQL RDS with real-time investment tracking deployed on AWS.',
        'Collaborated with stakeholders to align the app with business goals.',
      ],
    },
    {
      id: '2024',
      icon: clearear,
      title: 'Clear Ear',
      role: 'React Native Developer',
      description: [
        'Designed an Android app to manage patient appointments for a hearing clinic.',
        'Integrated local storage using AsyncStorage for efficient customer tracking.',
        'Streamlined clinic operations through customized app features.',
      ],
    },
    {
      id: '2020-2023',
      icon: MosGames,
      title: 'Mo’s Pvt',
      role: 'Developer & Analyst',
      description: [
        'Launched digital platforms and analyzed market trends for bubble tea expansion.',
        'Built and maintained the Mo’s Games website with HTML, CSS, and JavaScript.',
        'Optimized marketing strategies based on data insights.',
      ],
    },
  ];

  return (
    <div className="main" ref={mainContentRef}>
      {/* Hero Section */}
      <div className={`hero-section ${isMobileView ? '' : 'row'}`}>
        <div style={{ textAlign: 'center' }}>
          <img src={untitled} alt="Mohammed Bakhshi" />
          <div className="image-caption">Mohammed Bakhshi - Full Stack Developer</div>
        </div>

        {!isMobileView && <div className="divider"></div>}

        <div className="paragraph">
          <p>
            With over 7 years of experience as a Full Stack Developer and Data Analyst, I’ve built my career
            around designing efficient, user-focused solutions that bridge technical innovation with real-world impact.
          </p>
          <p>
            I’ve also been fortunate to combine my technical skills with entrepreneurial insight. For instance,
            I played a key role in launching innovative ventures, such as introducing fruit bubble tea to the Pakistani
            market while managing a dynamic gaming lounge in Lahore.
          </p>
          <p>
            If you’re interested in learning more about my projects or discussing collaboration opportunities, feel free to explore further.
          </p>
        </div>
      </div>

      {/* Tech Languages Section */}
      <h3 className="section-header">Tech Languages</h3>
      <div className="logo-container">
        {techLanguages.map(({ id, src, name }) => (
          <div
            key={id}
            style={{ position: 'relative' }}
            onMouseEnter={() => handleLogoHover(id)}
            onMouseLeave={() => handleLogoLeave(id)}
          >
            <img id={id} src={src} alt={name} className={isMobileView ? '' : 'wide'} />
            <div className={`tooltip ${tooltipVisible[id] ? 'visible' : ''}`}>{name}</div>
          </div>
        ))}
      </div>

      {/* Work History Section */}
      <h3 className="section-header">Work History</h3>
      <div className="work-history">
        {workHistory.map(({ id, icon, title, role, description }) => (
          <div key={id} className="work-card">
            <img src={icon} alt={title} className="work-icon" />
            <div className="work-content">
              <h4>{title}</h4>
              <h5>{role}</h5>
              <ul>
                {description.map((desc, index) => (
                  <li key={index}>{desc}</li>
                ))}
              </ul>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default MainContent;
